Объявлен конкурс на замещение вакантной должности Администратора Муйского районного суда Республики Бурятия 
Управление Судебного департамента в Республике Бурятия 
объявляет конкурс на замещение вакантной должности федеральной 
государственной гражданской службы 
(категория «руководители», ведущая группа должностей) 

- высшее образование; 
- без предъявления требований к стажу; 
- опыт административно-хозяйственной работы (по обеспечению безопасности и охраны зданий, по организации учета основных средств и материальных запасов, по осуществлению контроля за техническим, санитарно-гигиеническим, противопожарным состоянием зданий и сооружений, по подготовке зданий (помещений) к отопительному сезону, учет потребления коммунальных услуг, обеспечение бесперебойной работы транспорта и т.д.); 
- знать: 
Федеральные законы от 08.01.1998 № 7-ФЗ « О Судебном департаменте при Верховном Суде Российской Федерации », от 27.05.2003 № 58-ФЗ « О системе государственной службы Российской Федерации », от 27.07.2004 № 79-ФЗ « О государственной гражданской службе Российской Федерации », от 26.06.1992 № 3132-1 « О статусе судей в Российской Федерации », от 25.12.2008 № 273-ФЗ « О противодействии коррупции », нормативные правовые акты, касающиеся организационного обеспечения деятельности судов и регулирующие особенности прохождения гражданской службы; 
основы ведения делопроизводства, порядок работы со служебной информацией, основы проведения переговоров, заключения договоров, нормы и правила охраны труда, техники безопасности и пожарной безопасности; 
- уметь: 
работать с законодательными и нормативными правовыми актами, применять их на практике; 
разрабатывать план конкретных действий; 
оперативно принимать и осуществлять принятые решения; 
адаптироваться к новой ситуации и применять новые подходы к решению возникающих проблем; 
эффективно и последовательно организовывать взаимодействие с другими ведомствами и организациями; 
правильно распределять рабочее время; 
иметь навыки владения компьютерной и другой оргтехникой и необходимым программным обеспечением. 

2. Гражданин Российской Федерации, изъявивший желание участвовать в конкурсе, представляет в конкурсную комиссию следующие документы: 
1) личное заявление; 
2) собственноручно заполненную и подписанную анкету, утвержденную распоряжением Правительства Российской Федерации от 26.05.2005 № 667-р, с приложением фотографии 3х4, выполненной на матовой бумаге в черно-белом исполнении; 
3) собственноручно заполненную и подписанную автобиографию; 
4) копию паспорта или заменяющего его документа (подлинник документа предъявляется лично по прибытии на конкурс); 
5) копию трудовой книжки, заверенную нотариально или кадровой службой по месту работы (службы), или иные документы, подтверждающие трудовую (служебную) деятельность гражданина; 
6) характеристику с последнего места работы (службы); 
7) копию документов об образовании и о квалификации, а также по желанию гражданина копии документов, подтверждающих повышение или присвоение квалификации по результатам дополнительного профессионального образования, документов о присвоении ученой степени, ученого звания, заверенные нотариально или кадровой службой по месту работы (службы); 
8) копию военного билета или иные документы, подтверждающие военную службу; 
9) заключение медицинского учреждения о наличии (отсутствии) заболевания, препятствующего поступлению на государственную гражданскую службу Российской Федерации и муниципальную службу или ее прохождению (форма №001-ГС/у), утвержденное приказом Министерства здравоохранения и социального развития Российской Федерации от 14.12.2009 № 984н; 
10) справки, подтверждающие, что гражданин не состоит на учете в психоневрологическом и наркологическом диспансерах; 
11) справку о доходах, расходах, об имуществе и обязательствах имущественного характера гражданина, претендующего на замещение должности федеральной государственной службы, утвержденную Указом Президента Российской Федерации от 23.06.2014 № 460; 
12) справки о доходах, расходах, об имуществе и обязательствах имущественного характера супруги (супруга) и несовершеннолетних детей гражданина, претендующего на замещение должности федеральной государственной службы, утвержденные Указом Президента Российской Федерации от 23.06.2014 № 460; 
13) копию идентификационного номера налогоплательщика; 
14) справку из налогового органа о регистрации или отсутствии регистрации в качестве индивидуального предпринимателя, юридического лица; 
15) копию страхового медицинского полиса; 
16) копию страхового пенсионного свидетельства; 
17) справку о наличии (отсутствии) судимости и (или) факта уголовного преследования либо о прекращении уголовного преследования; 
18) сведения об адресах сайтов и (или) страниц сайтов в информационно-телекоммуникационной сети « Интернет », на которых гражданин, претендующий на замещение должности гражданской службы, размещал общедоступную информацию, а также данные, позволяющие его идентифицировать, за три календарных года, предшествующих году поступления на гражданскую службу, по форме, утвержденной распоряжением Правительства Российской Федерации от 28.12.2016 № 2867-р. 

3. Гражданский служащий иного государственного органа, изъявивший желание участвовать в конкурсе, подает заявление и собственноручно заполненную, подписанную и заверенную кадровой службой государственного органа, в котором гражданский служащий замещает должность гражданской службы, анкету, утвержденную распоряжением Правительства Российской Федерации от 26.05.2005 № 667-р, с приложением фотографии 3х4, выполненной на матовой бумаге в черно-белом исполнении, а также справку о своих доходах, расходах, об имуществе и обязательствах имущественного характера и справки о доходах, расходах, об имуществе и обязательствах имущественного характера супруги (супруга) и несовершеннолетних детей. 

4. Справки о доходах, расходах, об имуществе и обязательствах имущественного характера желательно заполнить с использованием специального программного обеспечения « Справки БК », размещенного на официальном сайте государственной информационной системы в области государственной службы в информационно-телекоммуникационной сети « Интернет », ссылка: https://gossluzhba.gov.ru/page/index/spravki_bk. 

Прием документов в течение 21 дня со дня, следующего за днем опубликования объявления на сайте http://usd.bur.sudrf.ru/ , т.е. по 28 ноября 2017 года включительно. 
Документы на участие в конкурсе принимаются по адресу: Управление Судебного департамента в Республике Бурятия, г. Улан-Удэ, ул. Профсоюзная, д. 9, каб. 7, тел. 8(3012)371993.

